import React from 'react';
import { searchJobList } from '../../redux/action/jobAction';
import { useDispatch } from 'react-redux';

const JobSearch = () => {
    const dispatch = useDispatch()
    const [location, setLocation] = useState('');
    const [description, setDescription] = useState('');
    const [type, setType] = useState('');
    const handleSubmit = ()=>{
        dispatch(searchJobList({description:description,location:location,type:type}))
        console.log('ok')
    }

    return (
        <div className='cari text-center text-white p-5 d-flex align-items-center'>
            <div className='col-12'>
                <h2 >Jelajahi 5000+ pekerjaan baru setiap bulan!</h2>
                <div className="row pt-4">
                    <div className="col-md-4 col-sm-6">
                        <input onChange={((e)=>{
                            setDescription(e.target.value)
                        })} class="form-control" type="text" value={description} aria-label="readonly input example" placeholder='Cari Lowongan' />
                    </div>
                    <div className="col-md-4 col-sm-6">
                        <input
                        onChange={((e)=>{
                            setLocation(e.target.value)
                        })}
                         class="form-control" type="text" value={location} aria-label="readonly input example" placeholder='Cari Lowongan' />
                    </div>
                    <div className="col-md-2 col-sm-6">
                        <select class="form-select" aria-label="Default select example">
                            <option selected>Jenis Pekerjaan</option>
                            <option value="FULL TIME">Full Time</option>
                            <option value="PART TIME">Part Time</option>
                        </select>
                    </div>
                    <div className="col-md-2 col-sm-6">
                        <button onClick={handleSubmit} className='btn btn-dark col-12'>Cari</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default JobSearch;
